// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "@openzeppelin/contracts/utils/Strings.sol";

contract Refund {
    // Model a Candidate
    struct Employee {
        uint256 id;
        string name;
        address public_address;
    }

    struct Employer {
        uint256 id;
        string name;
        address public_address;
    }
    struct contract_data {
        uint256 id;
        uint256 minimum_point_long;
        uint256 minimum_point_lat;
        uint256 maximum_point_long;
        uint256 maximum_point_lat;
        uint256 duration;
        uint256 last_checked;
        Employee employees;
        Employer employer;
    }

    struct locationData {
        uint256 lat;
        uint256 lng;
    }

    // Store accounts that have voted
    mapping(uint256 => contract_data) public contracts;
    uint256 public Contractcount;

    // Store Candidates
    // Fetch Candidate
    mapping(uint256 => Employee) public employees;
    // Store Candidates Count
    uint256 public Employeecount;

    mapping(uint256 => Employer) public employers;
    // Store Candidates Count
    uint256 public Employercount;

    // voted event
    event FoundLocationEvent(uint256 indexed _candidateId);

    uint256 val;

    function getLocation(uint256 lt, uint256 ln) public {
        val = lt;
    }

    function initialize_employers(address[] memory a) public {
        for (uint256 add = 0; add < a.length; add++) {
            addEmployer(
                string.concat("Employer ", Strings.toString(add)),
                a[add]
            );
        }
        // addEmployee("Employee 1" , a[1]);
    }

    function initialize_employees(address[] memory a) public {
        // addEmployer("Employer 1" , a[0]);
        for (uint256 add = 0; add < a.length; add++) {
            addEmployee(
                string.concat("Employee ", Strings.toString(add)),
                a[add]
            );
        }
    }

    function addEmployer(string memory _name, address user_address) private {
        Employercount++;
        employers[Employercount] = Employer(Employercount, _name, user_address);
    }

    function addEmployee(string memory _name, address user_address) private {
        Employeecount++;
        employees[Employeecount] = Employee(Employeecount, _name, user_address);
    }

    function Create_contract_data(
        uint256[2] memory minimum_points,
        uint256[2] memory maximum_points,
        uint256 duration,
        string memory employee_name,
        address employee_address,
        uint256 id
    ) public {
        addEmployee(employee_name, employee_address);
        Contractcount++;
        contracts[Contractcount] = contract_data(
